import NavBar from '../NavBar';

const Header = () => (
  <>
    <NavBar />
    <img
      className="md:w-full"
      src="https://res.cloudinary.com/db3njhxi0/image/upload/v1644634655/U-Dance/WhatsApp_Image_2022-02-11_at_9.56.11_PM_iwu2a1.jpg"
      alt=""
    />
    <h1 className="font-serif text-white text-center absolute top-20 left-40">U Dance</h1>
  </>
);

export default Header;
